=head1 DESCRIPTION

A list of users or sub groups that belong to a group. This is for
generating Amazon Q Business chat results only from document a user has
access to.

=head1 ATTRIBUTES


=head2 MemberGroups => ArrayRef[L<Paws::QBusiness::MemberGroup>]

A list of sub groups that belong to a group. For example, the sub
groups "Research", "Engineering", and "Sales and Marketing" all belong
to the group "Company".


=head2 MemberUsers => ArrayRef[L<Paws::QBusiness::MemberUser>]

A list of users that belong to a group. For example, a list of interns
all belong to the "Interns" group.


